import dummy from "./../db/contents.json";
import Content from "./Content";

const MainList = ({}) => {
  const contentsList = dummy.contents.map((content) => (
    <Content key={content.id} id={content.id} title={content.title}></Content>
  ));

  return (
    <div>
      <h1>전체 컨텐츠</h1>
      {contentsList}
    </div>
  );
};

export default MainList;
